import { useEffect, useState } from "react";
import { toast } from "react-toastify";
import { getProductList } from "../services/product";
import { constants } from "../utils/constants";
import { Link, useNavigate } from "react-router-dom";
import CategoryBar from "./categorybar";
import NavigationBar from "./navigationBar";

function ProductGallery() {
  const navigate = useNavigate();
  const [products, setProducts] = useState([]);

  useEffect(() => {
    loadProducts();
  }, []);

  const loadProducts = async () => {
    const response = await getProductList();
    console.log(response);
    setProducts(response);
  };

  // const getproductdetails = async (e) => {
  //   console.log("check :"+e.target.value);
  //   navigate('/item'+e.target.value)
  //   // const response = await getProductList()
  //   // if (response['status'] === 'success') {
  //   //   setProducts(response['data'])
  //   // } else {
  //   //   toast.error('Error while calling get /product api')
  //   // }
  // }

  return (
    <>
      {/* <NavigationBar /> */}
      <CategoryBar />
      <div style={{ position: "relative", minHeight: "100%", margin: "0" }}>
        <div className="">
          <div
            id="carouselExampleIndicators"
            style={{ height: "300px", paddingTop: "10px" }}
            className="carousel slide"
            data-ride="carousel"
          >
            <ol className="carousel-indicators">
              {/* <li data-target="#carouselExampleIndicators" data-slide-to="" class="active"></li>
    <li data-target="#carouselExampleIndicators" data-slide-to=""></li>
    <li data-target="#carouselExampleIndicators" data-slide-to=""></li> */}
            </ol>
            <div className="carousel-inner">
              <div className="carousel-item active">
                <img
                  className="d-block w-100"
                  src="https://ik.imagekit.io/major/images/NewAd1.png?updatedAt=1693155358690"
                  alt="First slide"
                ></img>
              </div>
              <div className="carousel-item">
                <img
                  className="d-block w-100"
                  src="https://ik.imagekit.io/major/images/NewAd2.png?updatedAt=1693155358604"
                  alt="Second slide"
                ></img>
              </div>
              <div className="carousel-item">
                <img
                  className="d-block w-100"
                  src="https://ik.imagekit.io/major/images/NewAd3.png?updatedAt=1693155358598"
                  alt="Third slide"
                ></img>
              </div>
            </div>
            <a
              className="carousel-control-prev"
              href="#carouselExampleIndicators"
              role="button"
              data-slide="prev"
            >
              <span
                className="carousel-control-prev-icon"
                aria-hidden="true"
              ></span>
              <span className="sr-only">Previous</span>
            </a>
            <a
              className="carousel-control-next"
              href="#carouselExampleIndicators"
              role="button"
              data-slide="next"
            >
              <span
                className="carousel-control-next-icon"
                aria-hidden="true"
              ></span>
              <span className="sr-only">Next</span>
            </a>
          </div>

          <h1 style={{ textAlign: "center", margin: 10 }}>Product Gallery</h1>
          <div className="row" style={{ marginTop: 50 }}>
            {products.map((product) => {
              return <Card/>
            })}
          </div>
        </div>
      </div>
    </>
  );
}

export default ProductGallery;

const Card = () => {
  return (
    <>
      <div class="card col-md-3" style="width: 18rem;">
        <img src="" class="card-img-top" alt="..." />
        <div class="card-body">
          <h5 class="card-title">Card title</h5>
          <p class="card-text">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </p>
        </div>
        <ul class="list-group list-group-flush">
          <li class="list-group-item">An item</li>
          <li class="list-group-item">A second item</li>
          <li class="list-group-item">A third item</li>
        </ul>
        <div class="card-body">
          <a href="#" class="card-link">
            Card link
          </a>
          <a href="#" class="card-link">
            Another link
          </a>
        </div>
      </div>
    </>
  );
};

